    "241": "Keep fighting until the countdown ends. End the stage with at least one character left standing to successfully complete the challenge. Each opponent you defeat will take time off the countdown.<br>Once the challenge begins, Geo Bursts will periodically be set off, dealing Geo DMG to your active character.",
